    render() {
        return (
            <div className='contain'>
                <h2>List all customer information!</h2>
                <div id='customer'>
                    <p className='names'>First Name</p>
                    <p className='names'>Last Name</p>
                    <p className='home'>Home City</p>
                </div>
                {indexList}
            </div>

        )
    }
}

export default OneCustomerContainer;
